const placa = $json.body.Placa || ''; // Obtém a placa ou usa uma string vazia
const cleanedPlaca = placa.replace(/[^a-zA-Z0-9]/g, ''); // Remove caracteres indesejados

// Verifica se a placa tem exatamente 7 caracteres
if (cleanedPlaca.length === 7) {
    return { cleanedPlaca }; // Retorna a placa limpa se estiver correta
} else {
    return { error: 'A placa não possui 7 caracteres válidos após a limpeza.' };
}

// Obtém a data e hora do campo
const currentDate = new Date($('Date & Time1').item.json.currentDate);

// Converte para o horário de São Paulo (GMT-3)
const options = { timeZone: 'America/Sao_Paulo', hour12: false };
const brazilianTime = new Date(currentDate.toLocaleString('en-US', options));

// Obtém o dia da semana (0 = Domingo, 1 = Segunda, ..., 6 = Sábado) e a hora
const dayOfWeek = brazilianTime.getDay(); // 0=Domingo, 1=Segunda, ..., 6=Sábado
const hour = brazilianTime.getHours();

// Verifica se a hora está entre 08:00 e 18:00 e se o dia é útil (segunda a sexta)
if (hour >= 8 && hour < 18 && dayOfWeek >= 1 && dayOfWeek <= 5) {
    return {
        json: {
            status: 'Horário funcionamento'
        }
    };
} else {
    return {
        json: {
            status: 'Fora do horário'
        }
    };
}

const placa = $json.body.Placa;
const cleanedPlaca = placa.replace(/[^a-zA-Z0-9]/g, '');
return { cleanedPlaca };

const agora = new Date().toLocaleString("pt-BR", { timeZone: "America/Sao_Paulo" });

// Divide data e hora
const [dataStrRaw, horaStr] = agora.split(' ');
const dataStr = dataStrRaw.replace(',', '');

// Extrai dia, mês e ano
const [dia, mes, ano] = dataStr.split('/');
const dataFormatada = `${dia}/${mes}/${ano}`;

// Novo formato ISO (YYYY-MM-DD)
const dataISO = `${ano}-${mes}-${dia}`;

// Monta a URL da execução
const executionId = $execution.id;
const workflowId = $workflow.id;
const baseUrl = "https://n8n.redequeroimoveis.com";
const executionUrl = `${baseUrl}/workflow/${workflowId}/executions/${executionId}`;

// Retorna tudo em um único objeto
return [{
  json: {
    data: dataFormatada,
    data_iso: dataISO,
    hora: horaStr,
    executionUrl: executionUrl
  }
}];
